import { Suspense, lazy } from "react"
const AdminLogActionbar = lazy(() => import("./AdminLogActionbar/AdminLogActionbar"))

export default function AdminLogs() {
    return (
        <Suspense fallback={<div className='loading-div'></div>}>
            <div className='AdminLogs'>
                <AdminLogActionbar />
            </div>
        </Suspense>
    )
}
